  "name": "Web Activity Tracker",
  "description": "Track your web activity and set time limits for websites",
  "version": "1.0.0",
  "manifest_version": 3,
  "permissions": [
    "storage",
    "tabs",
    "idle",
    "alarms",
    "activeTab"
  ],
  "host_permissions": ["<all_urls>"],
